    "900304": {
        "v0": {
            "Name": "终结技",
            "MaxLevel": 1,
            "Desc": "消耗所有能量点，进入终结态势，在回合内做出以下行动。终结态势期间敌方全体全属性抗性降低。<br><br>· 对敌方全体造成雷属性伤害，并对所有持有【红莲】的单体目标触发<color style='color:#f29e38'>【红莲开绽】</color>。<br>· 再次行动，对敌方全体造成雷属性伤害，并对所有持有【红莲】的单体目标触发<color style='color:#f29e38'>【红莲开绽】</color>。<br>· 再次行动，对敌方全体造成雷属性伤害，并对所有持有【红莲】的单体目标触发<color style='color:#f29e38'>【红莲开绽】</color>。<br>· 再次行动，对敌方全体造成雷属性伤害。最后移除敌方所有【红莲】，并退出终结态势。"
        }
    },
    "900305": {
        "v0": {
            "Name": "天赋",
            "MaxLevel": 1,
            "Desc": "<color style='color:#f29e38'><b>能量点</b></color><br>黄泉初始具有 0 点能量。持有足够能量点时，可以施放终结技。黄泉每获得 1 点能量，会对黄泉攻击的目标单体施加 1 枚【红莲】。若黄泉没有目标，则优先选择持有红莲数目多的目标和精英目标。<br><br>任意敌方被施加负面状态时，黄泉获得 1 点能量。该效果每回合至多触发1次。<br>敌方被击败或逃跑时，持有的红莲会转移到其他目标。<br><br><color style='color:#f29e38'><b>红莲开绽</b></color><br>消耗指定单体的【红莲】，每个单体最多消耗 3 枚。<br>对敌方全体造成雷属性伤害，此伤害视为终结技伤害。每消耗 1 枚红莲，此伤害额外提升 100%（此效果为独立提升）。"
        }
    },
    "900307": {
        "v0": {
            "Name": "秘技",
            "MaxLevel": 1,
            "Desc": "立刻击杀敌方目标。若未能击杀，则进入战斗后对敌方全体造成雷属性伤害，并获得一些能量点。"
        }
    },
